import { Card, Space } from "antd";

function TestCard({ networkDetails }) {
  return (
    <div>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title={<p>Network Details</p>}
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26", height: "211px" }}
      >
        <Space size={20}>
          <p>Protocol Type:</p>{" "}
          <p>
            <b>{networkDetails.ssid}</b>
          </p>
        </Space>
        <Space size={21}>
          <p>Protocol Type:</p>{" "}
          <p>
            <b>{networkDetails.wireless_standard}</b>
          </p>
        </Space>
        <Space size={22}>
          <p>Security Type:</p>{" "}
          <p>
            <b>{networkDetails.wireless_protocol}</b>
          </p>
        </Space>
        <Space size={15}>
          <p>Default Gateway</p>{" "}
          <p>
            <b>{networkDetails.default_gateway}</b>
          </p>
        </Space>
        <Space size={26}>
          <p>DNS Servers</p>{" "}
          <p>
            {networkDetails.dns_servers.forEach((dns) => {
              console.log({ dns });
              return dns;
            })}
          </p>
        </Space>
      </Card>
    </div>
  );
}

export default TestCard;
